var selectedListItem = null ;
CKEDITOR.dialog.add('template', function(editor) {
   return {
    title: editor.lang.template.widgetDialogWindowTitle,
    minWidth: 500,
    minHeight: 100,
	init: function( editor ) {
        var pluginDirectory = this.path;
        editor.addContentsCss( pluginDirectory + 'styles/template.css' );
    },
    onShow: function(e) {
      try {
        this.selectPage(editor.config.template.tabId);
        this.getElement().getFirst().removeStyle('z-index');
      } catch(e) {
        console.log(e);
      }
    },
    contents: [
      {
        id: 'template-team',
        label: editor.lang.template.tabTitleTeam,
        elements: [
          {
            id: 'team',
            type: 'html',
            html: '<div id="listView-ckeditor"></div>',
            label: editor.lang.template.tabTitleTeam,
            labelLayout: 'horizontal',
            setup: function(widget) {
              try {
                if('_t' === widget.data.type) {
                  this.getInputElement().data('url', widget.data.imagesrc);
                  this.getInputElement().data('type', widget.data.type);
                }
              } catch(e) {
                console.log(e);
              }
            },
            commit: function(widget) {
              try {
                if(this.getDialog()._.currentTabId === 'template-team') {
					var myTestImgDiag = "data:image/png;base64," ;// "<img src='"+CKEDITOR.plugins.getPath('template') +"views/diagram.png'/>"  ;
					var myTestImgRACI = "data:image/png;base64,";
                  console.log(selectedListItem);
				  if(selectedListItem.id == 1){
						widget.setData('imagesrc', myTestImgDiag);
				  }else{
						widget.setData('imagesrc', myTestImgRACI);
				  }
				  
                  widget.setData('type', '_t');
				  
                }
              } catch(e) {
                console.log(e);
              }
            },
            validate: function() {
              var isvalid = true;
              if(this.getDialog()._.currentTabId === 'template-team') {
                isvalid = (selectedListItem != null) ; 
              }
              return isvalid;
            },
            onShow: function() {
              console.log('show');
            },
            onLoad: function() {
              try {
                var self = this;
				$("#listView-ckeditor").kendoListView({
					dataSource: {
						data: [
							{ id:1 , name: "ORG CHART" , image:"data:image/png;base64," },
							{ id:2 , name: "RACI" , image: "data:image/png;base64,"}
						]
					},
					 template: " <div class='template-model' id='#= id #'>  <img  src='#= image #' /><h3>#:name#</h3>  </div>",
					 selectable: true,
					 change : function(e){
						 var dataItem = this.dataItem(this.select().first());
						 selectedListItem = dataItem ;
					 }
				});
                
              } catch(e) {
                console.log(e);
              }
            }
          }
        ]
      },
      {
        id: 'template-Dashboard',
        label: editor.lang.template.tabTitleDashboard,
        elements: [
          {
            id: 'dashboard',
            type: 'text',
            label: editor.lang.template.tabTitleDashboard,
            labelLayout: 'horizontal',
            setup: function(widget) {
              try {
                if('_p' === widget.data.type) {
                  this.setValue(widget.data.pkgname);
                  this.getInputElement().data('url', widget.data.pkgurl);
                }
              } catch(e) {
                console.log(e);
              }
            },
            commit: function(widget) {
              try {
                if(this.getDialog()._.currentTabId === 'template-Dashboard') {
                  widget.setData('dashboard', this.getValue());
                  widget.setData('pkgurl', this.getInputElement().data('url'));
                  widget.setData('type', '_p');
                }
              } catch(e) {
                console.log(e);
              }
            },
            validate: function() {
              var isvalid = true;
              if(this.getDialog()._.currentTabId === 'template-Dashboard') {
                isvalid = this.getValue() !== '';
              }
              return isvalid;
            },
            onLoad: function() {
              try {
                var self = this;
                if(self.getDialog()._.currentTabId === 'template-Dashboard' &&
                   '' === self.getInputElement().getValue()) {
                 // self.getDialog().getButton('ok').disable();
                }
              } catch(e) {
                console.log(e);
              }
            }
          }
        ]
      }       
    ]
  };
});
